import React from "react";
import { useOutletContext } from "react-router-dom";

export default function FMessages() {
  const messagingInfo = useOutletContext();
  return (
    <div className="freelanceDetail">
      <div className="topHeader">
        <h1>Messages</h1>
      </div>
      <div className="briefDetails">
        <div className="block1">
            {messagingInfo.clientIds}
            {messagingInfo.taskName}
            {messagingInfo.taskDescription}
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Minus
            dolor ullam, quia commodi corporis quisquam illum hic eos voluptate
            sequi distinctio, velit atque omnis consectetur labore rem, totam
            numquam autem iusto culpa dicta eius odit! Modi, quo eum expedita
            dignissimos voluptates, harum neque dolores nisi, doloribus incidunt
            quas fuga veniam!
          </p>
        </div>
      </div>
    </div>
  );
}
